    boxShadow: "0 2px 12px rgba(0, 0, 0, 0.1)",
  },
  th: {
    background: "#2563eb",
    color: "white",
    textAlign: "left",
    padding: "14px 16px",
    fontWeight: "600",
    fontSize: "15px",
  },
  td: {
    padding: "12px 16px",
    borderBottom: "1px solid #e5e7eb",
    color: "#374151",
    fontSize: "15px",
  },
  tr: {
    transition: "background 0.2s",
  },
  loading: {
    textAlign: "center",
    color: "#2563eb",
    fontSize: "16px",
  },
  noData: {
    textAlign: "center",
